sys_variable_value.value:
var opened_by = current.opened_by;
var opened_for = current.opened_for;

var openedBy = new GlideRecord('sys_user');
openedBy.addQuery('sys_id', opened_by);
openedBy.query();
if (openedBy.next()) {
	current.variables.question_opened_by = openedBy.getUniqueValue();
}

var openedFor = new GlideRecord('sys_user');
openedFor.addQuery('sys_id', opened_for);
openedFor.query();
if (openedFor.next()) {
	current.variables.question_opened_for = openedFor.getUniqueValue();
	current.variables.matricula = openedFor.getValue("u_registry");
}

